!(({util, languages}) => {
  const a = util.clone(languages.typescript);
  (languages.tsx = languages.extend("jsx", a)),
    delete languages.tsx.parameter,
    delete languages.tsx["literal-property"];
  const t = languages.tsx.tag;
  (t.pattern = RegExp(
    `(^|[^\\w$]|(?=</))(?:${t.pattern.source})`,
    t.pattern.flags
  )),
    (t.lookbehind = !0);
})(Prism);
